import React, {Component} from 'react'
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom';
import Routes from './Component/Routes';






class App extends Component{


  render(){






    return(
      <div className="app">
      <Router>
        <div>
      <TrailersLanding 
      genre={this.getMovieGenre}

      />
      <Routes />
      </div>
      </Router>

      <div className="trailers">

      </div>
      </div>

    );
  }
}
export default App;
